import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { User } from 'src/app/Models/User';
import { UserService } from 'src/app/Services/user.service';

@Component({
  selector: 'app-useredit',
  templateUrl: './useredit.component.html',
  styleUrls: ['./useredit.component.css']
})
export class UsereditComponent implements OnInit {
  user: User;
  userid: number;

  constructor(private service: UserService, private activeRoute: ActivatedRoute, private route: Router) { }

  ngOnInit() {
    this.userid = parseInt(localStorage.getItem('userid') || '0',10);  
    console.log("UserId = " + this.userid);
    this.service.getUserById(this.userid).subscribe(data => {
      this.user = data;
      console.log(this.user);
    })
  }

  onSubmit() {
    this.service.updateUser(this.userid, this.user).subscribe(data => {
      alert("User data updated!");
      this.route.navigate(['/userList']);
    },
      error => alert(error.errorMessage)
    );
  }
}
<div class="container">
    <form #productform="ngForm" (ngSubmit)="onSubmit()">
        <div>
            <h1>Edit Product</h1>
        </div>
        <div class="form-group">
            <label for="prodId">Product ID</label><br>
            <input #ProdId type="number" readonly name="prodId" class="form-control" [(ngModel)]="product.prodId">
        </div>
        <div class="form-group">
            <label for="prodName">Product Name</label><br>
            <input #ProdName="ngModel"  name="prodName" class="form-control" [(ngModel)]="product.prodName">
        </div>
        <div class="form-group">
            <label for="description">Description</label><br>
            <input #Description="ngModel" name="description" class="form-control" [(ngModel)]="product.description">
        </div>
        <div class="form-group">
            <label for="image">Image URL</label><br>
            <input #Image="ngModel" name="image" class="form-control" [(ngModel)]="product.image">
        </div>
        <div class="form-group">
            <label for="availablility">Availability</label><br>
            <input #Availablility="ngModel" name="availablility" class="form-control" [(ngModel)]="product.availaibility">
        </div>
        <div class="form-group">
            <label for="categoryId">Category ID</label><br>
            <input #CategoryId="ngModel" name="categoryId" class="form-control" [(ngModel)]="product.categoryId">
        </div>
        <div class="form-group">
            <label for="userId">User ID</label><br>
            <input #UserId="ngModel" name="userId" class="form-control" [(ngModel)]="product.userId">
        </div>
        <div class="form-group">
            <label for="price">Price</label><br>
            <input #Price="ngModel" name="price" class="form-control" [(ngModel)]="product.price">
        </div>
        <div class="form-group">
            <label for="stock_Quantity">Stock Quantity</label><br>
            <input #StockQuantity="ngModel" name="stock_Quantity" class="form-control" [(ngModel)]="product.stock_Quantity">
        </div>
        <div class="form-group">
            <a routerLink="editProduct"></a>
        </div>
        <button type="submit" class="btn btn-primary">Edit</button>
    </form>
</div>
